// Categories

function Categories(){
    return(
        <div className="categories">

        <p>Development</p>
        <p>Business</p>
        <p>IT & Software</p>
        <p>Personal Development</p>
        <p>Design</p>
        <p>Marketing</p>

    </div>
    )
}
export default Categories
